import ExpenseItem from "./components/ExpenseItem";



function App() {

  const expenses = [
    {
      id: 1,
      title: 'Car Insurance1',
      amount: 294.64,
      date: new Date(2023,1,1)
    },
    {
      id: 2,
      title: 'Car Insurance2',
      amount: 294.64,
      date: new Date(2023,1,1)
    },
    {
      id: 3,
      title: 'Car Insurance3',
      amount: 294.64,
      date: new Date(2023,1,1)
    },
    {
      id: 4,
      title: 'Car Insurance4',
      amount: 294.64,
      date: new Date(2023,1,1)
    }
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
